import React from 'react'
import 'TaskList.css'
const TaskList = (props) =>{
    return(
        <>
        <div className="list_style">
        <li>{props.text}</li>
        <i class="fas fa-trash-alt"></i>
        <i class="fas fa-check-circle"></i>

        </div>
       
  

        </>
    )
}
export default TaskList;
